import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Card from "./Card";

const Service = () =>{
    return(
        <>
            <div className="container">
                <div className="row">
                    <Card/>
                </div>
            </div>
        </>
    );
}


export default Service;
